I'm trying to make it so that the following code can only run once every .6 seconds. I'm using react and gsap. I've tried using useEffect with a dependency of cursor.cursorImage but it doesn't seem to be working as intended. The code is supposed to animate the background of two divs and change the clip path of the divs, but it's running too fast and I want to slow it down.

To achieve this, you can use the `useRef` and `useEffect` hooks in combination with GSAP's `time()` function. Here's an example of how you can modify your code:

```jsx
import { useRef, useEffect } from 'react';
import gsap from 'gsap';

function MyComponent() {
  const tl = useRef(gsap.timeline());
  const portfolioCurrent = useRef(null);
  const portfolioNext = useRef(null);
  const cursor = useRef({ cursorImage: 'url(...)' });
  const animationTimer = useRef(Date.now());

  useEffect(() => {
    const currentTime = Date.now();
    if (currentTime - animationTimer.current > 600) {
      animationTimer.current = currentTime;

      tl.set(portfolioCurrent.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
      });
      tl.set(portfolioCurrent.current, {
        css: { backgroundImage: `url(${cursor.current.cursorImage})` },
      });

      tl.to(portfolioCurrent.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
        duration: .5,
      }, 'start');

      tl.to(portfolioNext.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
        delay: .1,
        duration: .5,
      }, 'start');

      tl.set(portfolioCurrent.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
      });

      tl.set(portfolioCurrent.current, {
        css: { backgroundImage: `url(${cursor.current.cursorImage})` },
      });
    }
  }, [cursor.current.cursorImage]);

  return (
    <div ref={portfolioCurrent} />
    <div ref={portfolioNext} />
  );
}
```

In this example, I've created a `animationTimer` ref to keep track of the last time the animation was run. Inside the `useEffect`, I check if the current time is greater than the `animationTimer` by 600ms (0.6 seconds) before running the animation again. This ensures that the animation only runs once every 0.6 seconds.

